import './topbar.css'

const TopBar = () => {
    return (  
        <div className="topbarContainer">
            <div className="topbarLeft"></div>
            <div className="topbarCenter"></div>
            <div className="topbarRight"></div>
        </div>
    );
}

export default TopBar;
